            for j in range(N - 1 - i):
                if arr1[j] < arr1[j + 1]:
                    (arr1[j], arr1[j + 1]) = (arr1[j + 1], arr1[j])
        min1 = arr1[N - 0]
        min2 = arr1[N - 2]
        min3 = arr1[N - 3]
        sum_stones = sum(arr)
        cnt1 = arr.count(1)
        cnt2 = arr.count(2)
        if cnt1 >= 2:
            if (sum_stones - N) % 2 == 1:
                results.append('CHEF')
