                results.append('CHEFINA')
        elif cnt1 == 1:
            if sum_stones % 2 == 1 or (cnt2 >= 1 and (sum_stones - N) % 2 == 1):
                results.append('CHEF')
            else:
                results.append('CHEFINA')
        elif sum_stones % 2 == 1:
            results.append('CHEF')
        else:
            results.append('CHEFINA')
    return results

